        <SwiperSlide><img src="/media/person-3.jpeg" alt="Person image" /></SwiperSlide>
      <Swiper
        spaceBetween={50}
        slidesPerView={3}
        onSlideChange={() => console.log('slide change')}
        onSwiper={(swiper) => console.log(swiper)}
        >

        ...
      </Swiper>
      </div>
    </div>
  )
}

export default Gallery
